const TableRow = (props) => {
  const { videoBoard } = props;
  const { video } = props;

  return (
    <tr>
      <td>{video.videoNum}</td>
      <td>{videoBoard.videoNum}</td>
      <td>{videoBoard.videoBoardNum}</td>
      <td>{videoBoard.memberNum}</td>
      <td>{videoBoard.videoReply}</td>
      <td>삭제 버튼 자리</td>
    </tr>
  );
};

export default TableRow;
